import { Link } from 'react-router-dom';
const NavBar = () => {
    return (
        <nav>
            <ul>
                <li>
                    <Link to="/Login">Login lol</Link><></>
                    <Link to="/Home">Home lol</Link><></>
                    <Link to="/Calculate">Calculate lol</Link><></>
                    <Link to="/Contact">Contact lol</Link><></>
                </li>
            </ul>
        </nav>
    )
}

export default NavBar;
